(96756, 0, 0, 'Your souls will drift for eternity in the tides of the underworld!', 14, 0, 100, 0, 0, 0, 102193, 'Имирон, падший король to Player'),
(96756, 1, 0, 'Another drop in the sea of souls!', 14, 0, 100, 0, 0, 0, 102185, 'Имирон, падший король to Player'),
(96756, 2, 0, 'Mortals... Your wretched kind murdered MY people... destroyed MY kingdom! Long have I waited for a chance to repay what was done to me!', 14, 0, 100, 0, 0, 0, 102189, 'Имирон, падший король to Player'),
(96756, 3, 0, 'CRAVEN MAGGOTS!', 14, 0, 100, 0, 0, 0, 102176, 'Имирон, падший король to 0'),
(96756, 3, 1, 'FLEE, COWARDS!', 14, 0, 100, 0, 0, 0, 102175, 'Имирон, падший король to 0'),
(96756, 4, 0, 'Know the bitter chill of death as I have!', 14, 0, 100, 0, 0, 0, 102177, 'Имирон, падший король to 0'),
(96756, 4, 1, 'The winds of the frozen north still howl in these veins!', 14, 0, 100, 0, 0, 0, 102178, 'Имирон, падший король to 0'),
(96756, 5, 0, 'The shadows of the underworld bend to me!', 14, 0, 100, 0, 0, 0, 102171, 'Имирон, падший король to 0'),
